import React from 'react'

const Contact_Detail = () => {
     return (
          <>
               <section class="contact-details"><div class="contact-details-container"><div class="contact-details-card"><h2>Let's Talk.</h2><div class="contact-border"></div><h6>CONTACT DETAILS</h6><div class="contact-credentials"><p>Phone: <a href="tel:+92 334 7070725">+92 334 7070725</a></p><p>Email: <a href="mailto:Yousufkalim@outlook.com">Yousufkalim@outlook.com</a></p><p>Web: <a href="/">Kalim.Pk</a></p></div></div><div class="contact-details-card"><h2>Connect.</h2><div class="contact-border"></div><h6>SOCIAL PRESENCE</h6><div class="social-credentials"><div class="social-links"><a href="https://www.linkedin.com/in/yousufkalim/" target="_blank" rel="noreferrer"><span class="tooltip">linkedIn</span><i class="fab fa-linkedin-in" aria-hidden="true"></i></a><a href="https://facebook.com/MianYousufKalim" target="_blank" rel="noreferrer"><span class="tooltip">facebook</span><i class="fab fa-facebook-f" aria-hidden="true"></i></a><a href="https://twitter.com/Yousuf_Kalim" target="_blank" rel="noreferrer"><span class="tooltip">twitter</span><i class="fab fa-twitter" aria-hidden="true"></i></a><a href="https://www.instagram.com/yousuf.kalim/" target="_blank" rel="noreferrer"><span class="tooltip">instagram</span><i class="fab fa-instagram" aria-hidden="true"></i></a></div></div></div><div class="contact-details-card"><h2>Find Me.</h2><div class="contact-border"></div><h6>ADDRESS</h6><p class="contact-address">Kalim Web Solutions Near Railway Station, Raiwind Kalaan, District Lahore</p></div></div></section>
          </>
     )
}

export default Contact_Detail
